import React from 'react';

import classes from './HomePage.css';

const homepage = () => (
    <div className={classes.HomePage}>
        <h2 class="body--header__h2">The eternal recipe for</h2>
        <h1 class="body--header__h1">Success</h1>
        <h2 class="body--header__h2">Is to don't stop learn and improve! </h2>
    </div>
);

export default homepage;
